INSERT INTO `article` VALUES (20, '就当前经济形势和下半年经济工作 中共中央召开党外人士座谈会 习近平主持并发表重要讲话20', '央视网新闻20', '央视网消息（新闻联播）：7月28日，中共中央在中南海召开党外人士座谈会，就当前经济形势和下半年经济工作听取各民主党派中央、全国工商联负责人和无党派人士代表的意见和建议。中共中央总书记习近平主持座谈会并发表重要讲话，强调要正确认识当前经济形势，深入调查研究，以更大的力度推进全面深化改革，积极破解发展面临的各种难题、化解来自各方面的风险挑战和巨大压力，为推进改革发展、战胜各种风险挑战凝聚广泛共识、汇聚强大力量。我们有坚强决心、坚定意志、坚实国力应对挑战，有足够的底气、能力、智慧战胜各种风险考验，任何国家任何人都不能阻挡中华民族实现伟大复兴的历史步伐。20', '2020-07-30 16:55:36', 1);
INSERT INTO `article` VALUES (21, '就当前经济形势和下半年经济工作 中共中央召开党外人士座谈会 习近平主持并发表重要讲话21', '央视网新闻21', '央视网消息（新闻联播）：7月28日，中共中央在中南海召开党外人士座谈会，就当前经济形势和下半年经济工作听取各民主党派中央、全国工商联负责人和无党派人士代表的意见和建议。中共中央总书记习近平主持座谈会并发表重要讲话，强调要正确认识当前经济形势，深入调查研究，以更大的力度推进全面深化改革，积极破解发展面临的各种难题、化解来自各方面的风险挑战和巨大压力，为推进改革发展、战胜各种风险挑战凝聚广泛共识、汇聚强大力量。我们有坚强决心、坚定意志、坚实国力应对挑战，有足够的底气、能力、智慧战胜各种风险考验，任何国家任何人都不能阻挡中华民族实现伟大复兴的历史步伐。21', '2020-07-30 16:55:37', 1);
