INSERT INTO `article` VALUES (30, '柯达改行制药！胶卷变胶囊，也是专业对口？30', '中国新闻网30', '中新网客户端北京7月31日电 (彭婧如)30日，“柯达一夜熔断13次”登上微博热搜榜。\n\n网友：生产胶卷的那个柯达吗？还以为是同名。\n\n柯达：不是同名，是我本尊。\n\n柯达改行制药！胶卷变胶囊，也是专业对口？\n2009年6月24日，柯达公司宣布于2009年停止生产拥有74年历史的柯达彩色胶片。\n\n柯达改行制药，股价暴涨频频熔断。30', '2020-07-30 16:57:37', 1);
